impl_scope! { #[widget{ layout = column: [ align(center): self.display, row: [ TextButton::new_msg("−", Increment(-1)), TextButton::new_msg("+", Increment(1)), ], ]; }] #[derive(Debug)] struct Counter { core: widget_core!(), #[widget] display: Label<String>, count: i32, } impl Self { fn new(count: i32) -> Self { Counter { core: Default::default(), display: Label::from(count.to_string()), count, } } }
}; First note the simple constructor: fn Counter::new. (Reminder: impl Self is expanded to impl Counter by the impl_scope! macro.) Our widget's layout is here defined by the layout = .. parameter. (An alternative is to implement Layout directly.) The layout syntax is new, but should be easy to understand: Our top layout is a column containing ... ... the field self.display, annotated with align(center) ... ... and a row of two TextButton widgets In general, layout syntax is one of four things: a keyword such as column or align(..), followed by a : and some sub-layout (or list of sub-layouts) self.foo where foo is a field implementing Layout (possibly but not necessarily a widget) Foo::new(..) where Foo is a type name (starting upper-case), the type is a Widget , and the whole expression Foo::new(..) constructs an object which coerces to dyn Widget "blah blah" — a simple label It's a bit more complex than this, but that should get you started. You can read the reference here: kas::macros::widget . Aside: since KAS is a stateful UI system, the TextButton widgets in our row must be stored somewhere , right? Yes: in the widget_core! field (a generated type).

