Lets implement Widget::handle_message on Counter: # use kas::prelude::*;
# use kas::widgets::{Label, TextButton};
# #[derive(Clone, Debug)] struct Increment(i32);
impl_scope! { #[widget{ layout = column: [ align(center): self.display, row: [TextButton::new_msg("−", Increment(-1)), TextButton::new_msg("+", Increment(1))], ]; }] #[derive(Debug)] struct Counter { core: widget_core!(), #[widget] display: Label<String>, count: i32, } impl Widget for Self { fn handle_message(&mut self, mgr: &mut EventMgr, _: usize) { if let Some(Increment(incr)) = mgr.try_pop_msg() { self.count += incr; *mgr |= self.display.set_string(self.count.to_string()); } } }
}; The method HasString::set_string returns a TkAction (to notify that a redraw is required). TkAction is a #[must_use] type which should be fed to EventState::send_action , or equivalently: *mgr |= action. Unhandled messages Aside: what if we forgot to write our handle_message implementation and left the message on the stack? Assuming you have a logger enabled, you'd see something like this: [2022-08-20T14:33:47Z DEBUG kas_core::event::manager::messages] push_msg: counter::main::Increment::Increment(1)
[2022-08-20T14:33:47Z WARN kas_core::event::manager::messages] unhandled: counter::main::Increment::Increment(1) Now perhaps you see why we defined our Increment type and didn't simply push an i32!

